import React from 'react';
import { Button, Dialog, DialogTitle, DialogContent, DialogContentText, DialogActions } from '@material-ui/core';

interface Props {
  open: boolean;
  onClose: () => void;
  yes: string;
  no: string;
}

const CustomDialog: React.FC<Props> = ({ open, onClose, yes, no }) => {
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>This is a dialog</DialogTitle>
      <DialogContent>
        <DialogContentText>This is some dialog content</DialogContentText>
      </DialogContent>
      <DialogActions>
        <Button onClick={onConfirmDialogClose} variant="contained" color="secondary">
          {No}
        </Button>
        <Button onClick={onYesClick} className="ms-3" variant="contained" color="primary">
          {Yes}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default CustomDialog;
